@ananavarro We all deal with no shoes, no shirt, no service. What's such a big deal about no mask, no service? I don't get it. Can't people care about others? And it reduces the chances the mask wearer will be infected significantly too. Seems like a win-win to me. 
#science
#MaskItOrCasket

